XOXO', u'id': u'10152303645001469_32267655', u'user_likes': False}, {u'from': {u'id': u'724045823', u'name': u'Carlos Pedraza'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2014-03-25T23:24:59+0000', u'message': u'What? I missed it?!! Dammit! Happy [belated] burp day!', u'id': u'10152303645001469_32279723', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2014-03-26T02:33:48+0000', u'message': u'thanks for the wishes.  Carlos, thanks and no biggie.  I know you were busy working on this summers LGBT film festival circuit blockbuster.', u'id': u'10152303645001469_32281930', u'user_likes': False}, {u'from': {u'id': u'730551422', u'name': u'Haniff Somani'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2014-03-26T03:47:02+0000', u'message': u'Happy belated Josh!! Hope you had a great day.', u'id': u'10152303645001469_32282651', u'user_likes': False}]}

{u'paging': {u'cursors': {u'after': u'MTM=', u'before': u'MQ=='}}, u'data': [{u'from': {u'id': u'556642634', u'name': u'Ravi Sarma'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2013-11-14T14:18:16+0000', u'message': u'We've already moved. I have not seen a bigger command line mess in my life (and that includes Unix 'find' and other hits).

Satire notwithstanding: thing is it's free and has a robust ecosystem around it, and if you do Open Source, then GitHub is sweet.', u'id': u'10152012574731469_30419011', u'user_likes': False}, {u'from': {u'id': u'540837663', u'name': u'Alan Batie'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-11-14T16:52:43+0000', u'message': u'A friend and co-worker prefers cvs because the repository is text and can be fixed if it gets corrupted.  And it's what he's been using for however long cvs has been around ;-)  I'm liking what I see of git, though I think you run the risk of ending up with many different version sets.', u'id': u'10152012574731469_30420803', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-11-14T23:22:59+0000', u'message': u'what do you mean by version sets?', u'id': u'10152012574731469_30425752', u'user_likes': False}, {u'from': {u'id': u'501207320', u'name': u'Chris Wright'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-11-14T23:31:32+0000', u'message': u'Anyone who says git sucks I invite to try perforce. If they don't run screaming, then they're yet another casualty... :)', u'id': u'10152012574731469_30425895', u'user_likes': False}, {u'from': {u'id': u'501207320', u'name': u'Chris Wright'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2013-11-14T23:32:36+0000', u'message': u'I also like people's ignorance, I.e. "http://stackoverflow.com/questions/3859/what-is-the-difference-between-all-the-different-types-of-version-control" -- "git -very hot since Linus switched to it"

Uh... Linus MADE it. I suppose a similar argument could be made that Windows became hot when BillG switched to it?', u'id': u'10152012574731469_30425913', u'user_likes': False}, {u'from': {u'id': u'584748571', u'name': u'Tague Griffith'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2013-11-14T23:37:42+0000', u'message': u'Dear neards, please use whatever fucking tool works for you and shut the fuck up about it please.   Can we talk about boys for a change.', u'id': u'10152012574731469_30425970', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2013-11-14T23:39:04+0000', u'message': u'git merge origin/emergency-twink-fix', u'id': u'10152012574731469_30425985', u'user_likes': False}, {u'from': {u'id': u'501207320', u'name': u'Chris Wright'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2013-11-14T23:40:09+0000', u'message': u'git checkout dat-hottie-branch', u'id': u'10152012574731469_30425997', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 2, u'can_remove': True, u'created_time': u'2013-11-14T23:41:07+0000', u'message': u'uh oh.  unresolved conflicts', u'id': u'10152012574731469_30426005', u'user_likes': False}, {u'from': {u'id': u'534741425', u'name': u'Darrel Farris'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-11-14T23:41:28+0000', u'message': u'I'm in CA SCM land now.  Wow.', u'id': u'10152012574731469_30426011', u'user_likes': False}, {u'from': {u'id': u'540837663', u'name': u'Alan Batie'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-11-14T23:46:27+0000', u'message': u'Since each git is its own repository, if you clone something into multiple places and aren't rigorous about merging them back into a central repository, they're basically going to fork.', u'id': u'10152012574731469_30426068', u'user_likes': False}, {u'from': {u'id': u'556642634', u'name': u'Ravi Sarma'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-11-15T00:22:49+0000', u'message': u'Chris Wright: count me in that tally. I have used both Perforce and Git (and SCCS, yes SCCS, RCS, CVS and Subversion) and I find Perforce infinitely easier to use than Git. This is the point where someone will point out all the magical things Git can do that Perforce cannot (and that's definitely not an empty set) but I have learnt to follow Zed Shaw's advise: https://twitter.com/zedshaw/status/64883570388373504 :-). So instead of arguing the merits and demerits, I like to say that Perforce is better than Git for fools, and there are more fools (like me) in the world than the smart people who *need* to understand what a "detached head" is to use a VCS.', u'id': u'10152012574731469_30426448', u'user_likes': False}, {u'from': {u'id': u'122604523', u'name': u'Paul Schreiber'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2013-11-15T06:04:33+0000', u'message': u'RCS4EVA', u'id': u'10152012574731469_30429926', u'user_likes': True}]}

