{u'paging': {u'cursors': {u'after': u'OQ==', u'before': u'MQ=='}}, u'data': [{u'from': {u'id': u'1155301131', u'name': u'Colby Tait'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-14T23:49:01+0000', u'message': u'None.  It makes me ill', u'id': u'10151684658661469_28355962', u'user_likes': False}, {u'from': {u'id': u'896355256', u'name': u'Corey Lewis'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-14T23:56:47+0000', u'message': u'kinect sports is really fun. specifically, kinect PING PONG is amazing, and kinda scarily accurate to real ping pong. if you play it with a ping pong paddle IN HAND, the simulation effect is almost flawless! and, between points, you can like dance around and kinda taunt your opponent. it rulez

there's another fun game called "child of eden" which is like a flying / shooting game where you feel like a wizard coz wherever you point, you shoot lazer beams. and the environments are very fantastical and vibrant. 

also: "Dance Central" for kinect is pretty insanely fun and actually taught me a lot of dances i never knew before. nerdy but true. it's like the next evolution of Dance Dance Revolution http://www.youtube.com/watch?v=Kd5PwZERMe0', u'id': u'10151684658661469_28356028', u'user_likes': False}, {u'from': {u'id': u'566505193', u'name': u'Nevin Williams'}, u'like_count': 2, u'can_remove': True, u'created_time': u'2013-06-14T23:58:32+0000', u'message': u'Fruit Ninja.    Great workout, serious or silly as desired.', u'id': u'10151684658661469_28356040', u'user_likes': False}, {u'from': {u'id': u'584748571', u'name': u'Tague Griffith'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-15T00:00:02+0000', u'message': u'Fruit Ninja', u'id': u'10151684658661469_28356057', u'user_likes': False}, {u'from': {u'id': u'553540611', u'name': u'Alex Hopmann'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-15T01:26:55+0000', u'message': u'Dance central! Plus <redacted> is amazing. :)', u'id': u'10151684658661469_28356865', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-15T05:36:24+0000', u'message': u'thanks folks!', u'id': u'10151684658661469_28358740', u'user_likes': False}, {u'from': {u'id': u'566505193', u'name': u'Nevin Williams'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-15T07:19:39+0000', u'message': u'You're not gonna tell us which one you like...?', u'id': u'10151684658661469_28359291', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-15T07:21:39+0000', u'message': u'I dont have any yet.  thinking of which to buy.', u'id': u'10151684658661469_28359308', u'user_likes': False}, {u'from': {u'id': u'534741425', u'name': u'Darrel Farris'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2013-06-15T23:43:25+0000', u'message': u'Just Dance 3.  Kinect Adventures is lots of fun, too.  And... ummm... Zumba Core  *hide*', u'id': u'10151684658661469_28367800', u'user_likes': False}]}

{u'paging': {u'cursors': {u'after': u'MjU=', u'before': u'MQ=='}, u'next': u'https://graph.facebook.com/v1.0/569966468_10151267018431469/comments?access_token=CAACEdEose0cBAPvhcZCRMVkXYCrbdiXUWhfBuA0UMGqXTeV8TF1iwWBJ9SINex3TpkNyw9Vk2kAijxfwlACAi4FUUUPiMQHOxtvmZCsaUkfVG9vHjKmicW0NzBszgCPJNVtGpkwsNqaxhSCjlPOIpjh3BuGZBA6ZAxKObAdTa0qLprnzavfeJDiB1NpheGRkifXmGkkZAoQZDZD&limit=25&after=MjU%3D'}, u'data': [{u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:15:28+0000', u'message': u'Holy what the hell? Are you here this weekend? I thought I smelled something fishy.', u'id': u'10151303444065850_26254428', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:16:01+0000', u'message': u'For two weeks babe.', u'id': u'10151303444065850_26254431', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'message_tags': [{u'length': 13, u'offset': 60, u'type': u'user', u'id': u'1309663723', u'name': u'Just Jennifer'}], u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:17:09+0000', u'message': u'are you fucking kidding me? HEEEEEEEEEEEEEEELLLLLLLLLZ YES. Just Jennifer, it's on. I'm so pleased! We have to do dinner/whatever immediately.', u'id': u'10151303444065850_26254441', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:19:54+0000', u'message': u'I'll be in tomorrow night at 9:30.', u'id': u'10151303444065850_26254453', u'user_likes': False}, {u'from': {u'id': u'1309663723', u'name': u'Just Jennifer'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:20:35+0000', u'message': u'OMG.', u'id': u'10151303444065850_26254458', u'user_likes': False}, {u'from': {u'id': u'1309663723', u'name': u'Just Jennifer'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:21:33+0000', u'message': u'Two weeks!  He can get the full pacific northwest anarchist treatment with that kind of time.  :D', u'id': u'10151303444065850_26254463', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:23:39+0000', u'message': u'Well, most of my time is spoken for, don't hate me, I am working on the marriage equality campaign. 

(If there were a ballot initiative to jail all the Wall Streeters, I would gladly work on that.)', u'id': u'10151303444065850_26254475', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:24:41+0000', u'message': u'Yeah, well, you'll have time for a dinner or two or we're never speaking again, so there's that. But yes, let us know what your schedule is like and we'll take you to get rained on and to yell at cops or something.', u'id': u'10151303444065850_26254481', u'user_likes': False}, {u'from': {u'id': u'1309663723', u'name': u'Just Jennifer'}, u'message_tags': [{u'length': 7, u'offset': 45, u'type': u'user', u'id': u'763900849', u'name': u'Biskits'}], u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:25:11+0000', u'message': u'Oh oh oh....well, poop.  You are a friend of Biskits so we can't heckle you.  Ok I will be nice.  I mean we wouldn't want to ruin Biskits reputation.', u'id': u'10151303444065850_26254484', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:25:30+0000', u'message': u'shut it, I heckle him every time we talk', u'id': u'10151303444065850_26254487', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 2, u'can_remove': False, u'created_time': u'2012-10-27T07:25:56+0000', u'message': u'my last words to him at Netroots were "Scott, remember to smash capitalism!"', u'id': u'10151303444065850_26254490', u'user_likes': False}, {u'from': {u'id': u'1309663723', u'name': u'Just Jennifer'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:26:17+0000', u'message': u'YES yelling at cops!  Let's shut down the port while he is here.  We do that for all of our cool out of town guests.', u'id': u'10151303444065850_26254494', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:26:44+0000', u'message': u'I was told marriage equality WOULD destroy civilization. Was I lied to?', u'id': u'10151303444065850_26254498', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:27:06+0000', u'message': u'^^^^ See, at least his heart is in the right place.', u'id': u'10151303444065850_26254503', u'user_likes': False}, {u'from': {u'id': u'1309663723', u'name': u'Just Jennifer'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:27:41+0000', u'message': u'I am trying to remember if we are doing anything scandalous in the next two weeks.', u'id': u'10151303444065850_26254509', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'message_tags': [{u'length': 5, u'offset': 70, u'type': u'user', u'id': u'534141648', u'name': u'Scott'}], u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:29:26+0000', u'message': u'I honestly can't think of anything, what are you doing for Halloween, Scott?', u'id': u'10151303444065850_26254524', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:30:35+0000', u'message': u'I have no plans after Newark. But I will be WAUM's bitch.', u'id': u'10151303444065850_26254534', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:31:35+0000', u'message': u'Oh totes. I'd probably even attend a WAUM mixer or whatever just to see you.*

*as long as the booze is cheap to free.', u'id': u'10151303444065850_26254544', u'user_likes': False}, {u'from': {u'id': u'1309663723', u'name': u'Just Jennifer'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:31:52+0000', u'message': u'Upon reviewing my event list all I saw was the 80's dance party/fund raiser at the Highline along with all the other regular anarchist things we do at the Wildcat.', u'id': u'10151303444065850_26254545', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:34:18+0000', u'message': u'we'll work something out. I'm so pleased!!!', u'id': u'10151303444065850_26254553', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'message_tags': [{u'length': 5, u'offset': 0, u'type': u'user', u'id': u'534141648', u'name': u'Scott'}, {u'length': 4, u'offset': 16, u'type': u'user', u'id': u'10217364', u'name': u'Mara'}], u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:35:20+0000', u'message': u'Scott, you know Mara lives here now.', u'id': u'10151303444065850_26254556', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 0, u'can_remove': False, u'created_time': u'2012-10-27T07:37:07+0000', u'message': u'If I did, I forgot.', u'id': u'10151303444065850_26254564', u'user_likes': False}, {u'from': {u'id': u'534141648', u'name': u'Scott Wooledge'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:37:37+0000', u'message': u'Did someone say 80s dance?!', u'id': u'10151303444065850_26254566', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 1, u'can_remove': False, u'created_time': u'2012-10-27T07:38:23+0000', u'message': u'http://www.youtube.com/watch?v=v3rhQc666Sg', u'id': u'10151303444065850_26254570', u'user_likes': False}, {u'from': {u'id': u'763900849', u'name': u'Ian \xc1wesome'}, u'like_count': 2, u'can_remove': False, u'created_time': u'2012-10-27T07:38:46+0000', u'message': u'Omg, Jennifer, I forgot! Scott remembers the 80s and everything, just like you! it'll be perfect', u'id': u'10151303444065850_26254573', u'user_likes': False}]}

{u'paging': {u'cursors': {u'after': u'MTI=', u'before': u'MQ=='}}, u'data': [{u'from': {u'id': u'27318078', u'name': u'Jerame Davis'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T18:31:27+0000', u'message': u'You know, I get tired of these type of attacks on occupiers. The munging of multiple logical fallacies and the utter lack of understanding of the occupy argument makes this a useless comparison.

The occupy movement isn't about outlawing corporations or their products, it's about the undue influence they have over our economy and particularly our government. What the anarchist/occupier is wearing is completely irrelevant to the discussion.

Besides, in a world dominated by multi-national corporations and the inability/impracticality of making your own clothes and shoes, what the hell else are they going to wear?', u'id': u'278388835588672_1422978', u'user_likes': False}, {u'from': {u'id': u'757247888', u'name': u'Amy Blumenfield'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T18:46:05+0000', u'message': u'You're making the association between these anarchist/thugs and the occupy folks. I dpm', u'id': u'278388835588672_1423019', u'user_likes': False}, {u'from': {u'id': u'757247888', u'name': u'Amy Blumenfield'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T18:46:15+0000', u'message': u'I don't think that they are one & the same.', u'id': u'278388835588672_1423022', u'user_likes': False}, {u'from': {u'id': u'500991232', u'name': u'Kes Wold'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T18:49:36+0000', u'message': u'that image is an attack on a Black Bloc anarchist, who probably has a BofA checking account as well.  Are you saying anarchists and occupiers are one and the same?  Either way, hypocrisy is completely relevant in this debate.', u'id': u'278388835588672_1423035', u'user_likes': False}, {u'from': {u'id': u'27318078', u'name': u'Jerame Davis'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T19:16:41+0000', u'message': u'Maybe they're not occupiers, and just anarchists, but the critique remains the same. It's a totally irrelevant way of dismissing any legitimate issues these folks might have. It's been used against the occupiers as well.', u'id': u'278388835588672_1423093', u'user_likes': False}, {u'from': {u'id': u'500991232', u'name': u'Kes Wold'}, u'like_count': 1, u'can_remove': True, u'created_time': u'2012-05-04T19:21:07+0000', u'message': u'you know what another irrelevant way of dismissing their issues is?  property destruction.  It's not just big corporate buildings, either.  Ask the cupcake shop and car owners in the Mission down in SF.', u'id': u'278388835588672_1423103', u'user_likes': False}, {u'from': {u'id': u'27318078', u'name': u'Jerame Davis'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T19:35:30+0000', u'message': u'I don't condone the destruction of anyone's property. I agree with you, it makes it hard to take their issues seriously. Still, two wrongs don't make a right and this image demonstrates a complete lack of understanding of the underlying issues.', u'id': u'278388835588672_1423140', u'user_likes': False}, {u'from': {u'id': u'500991232', u'name': u'Kes Wold'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T19:58:53+0000', u'message': u'Enlighten me: what is the underlying issue that results in taking a garbage can lid to a plate glass window that is not being understood here?', u'id': u'278388835588672_1423198', u'user_likes': False}, {u'from': {u'id': u'27318078', u'name': u'Jerame Davis'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T20:25:19+0000', u'message': u'Enlighten me: Do you really think they're doing it for sport? Come on. I don't know what their issue is - I misidentified them as occupiers. But every protest action - whether it's peaceful or ends in violence or property destruction - has an underlying issue. If you cannot recognize that fact, I don't know how or why we can would continue this conversation.', u'id': u'278388835588672_1423284', u'user_likes': False}, {u'from': {u'id': u'500991232', u'name': u'Kes Wold'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-04T20:53:59+0000', u'message': u'I can't be against the insane profits of Starbucks on my way to pick up a Venti Latte.  Pointing out that kind of hypocrisy is not only fair game, it's insanely appropriate, maybe even educational.  You should look into what anarchists really want, what their "issue" is.  But, since you've both drawn offense at people misunderstanding the underlying issue, then admitted you don't know what the underlying issue is yourself, perhaps we are done here sir.', u'id': u'278388835588672_1423358', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-05T00:18:09+0000', u'message': u'Oh come on! This was just getting good guys.  A number of these anarchists did their damage, and then took off their black clothing revealing normal clothing and then blended into the crowd.  I saw a video of one of them doing it right in front of a news crew!  I can't decide if that was ballsy or cowardly.', u'id': u'278388835588672_1423793', u'user_likes': False}, {u'from': {u'id': u'1363479636', u'name': u'Ross Karr'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2012-05-05T04:59:53+0000', u'message': u'ballsy. Wearing the clothing of whom they hate is just part of the madness of society. Im sure they would be glad to make their own clothes. When you have no choice you do things that dont necessarily sacrfice your values. It may look to you as hypocrytical. Ive been homeless and starving, down to 110 pounds and you take what food you can get even if its from whom you despise. ITS CALLED SURVIVAL. Ive gotten a North Face jacket,  LL Bean pants  and much more from the salvation army. Maybe you folks will learn something from my comment.', u'id': u'278388835588672_1424559', u'user_likes': False}]}

{u'paging': {u'cursors': {u'after': u'MTQ=', u'before': u'MQ=='}}, u'data': [{u'from': {u'id': u'100000473918042', u'name': u'Matthew Edward Lyon'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T20:41:30+0000', u'message': u'I thought clouds were forever', u'id': u'195704430471369_2673151', u'user_likes': False}, {u'from': {u'id': u'750350213', u'name': u'Anthony B Warren'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T20:42:30+0000', u'message': u'd'oh!', u'id': u'195704430471369_2673156', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T20:43:28+0000', u'message': u'@matt:  that's *diamonds* are forever', u'id': u'195704430471369_2673158', u'user_likes': False}, {u'from': {u'id': u'514351025', u'name': u'Jd Drewes'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T20:47:18+0000', u'message': u'"From up and down, and still somehow
