I really don't know clouds at all" -- Joni Mitchell', u'id': u'195704430471369_2673182', u'user_likes': False}, {u'from': {u'id': u'1389752480', u'name': u'Jishnu Mukerji'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T20:56:59+0000', u'message': u'A bit of a thunderstorm? :)', u'id': u'195704430471369_2673207', u'user_likes': False}, {u'from': {u'id': u'27318078', u'name': u'Jerame Davis'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T21:23:41+0000', u'message': u'And this is why the move toward cloud computing is not a terribly great move. I prefer to own and control my own data, thank you very much.', u'id': u'195704430471369_2673275', u'user_likes': False}, {u'from': {u'id': u'1291842258', u'name': u'Carlo DeCarlo'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T21:41:39+0000', u'message': u'Oh no! IT'S SKYNET!', u'id': u'195704430471369_2673344', u'user_likes': False}, {u'from': {u'id': u'1208446', u'name': u'Nathan Burkhart'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T21:46:00+0000', u'message': u'Wow, it was actually pretty damn close to Skynet: http://movies.msn.com/paralleluniverse/terminator-fans-celebrate-as-skynet-becomes-self-aware/story/feature/', u'id': u'195704430471369_2673354', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T22:26:36+0000', u'message': u'A good question is if Amazon's overall uptime is better than an individual could manage.  Another is why the claims of redundancy in clouds didn't hold to be true.', u'id': u'195704430471369_2673551', u'user_likes': False}, {u'from': {u'id': u'1389752480', u'name': u'Jishnu Mukerji'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T22:32:12+0000', u'message': u'Because all the connections among the redundant pieces all physically ran through the same single conduit or some moral equivalent thereof? A rather common cause for failure of redundancy. Remember the Turkish Airline DC-10 crash outside Paris?', u'id': u'195704430471369_2673577', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T23:12:42+0000', u'message': u'Ah yes.  981.  Improperly locked cargo door blows out.  Passenger cabin seats and debris sever the conduit containing redundant control wires. Out of control, crashes.', u'id': u'195704430471369_2673725', u'user_likes': False}, {u'from': {u'id': u'1389752480', u'name': u'Jishnu Mukerji'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T23:22:55+0000', u'message': u'Yep. That one.', u'id': u'195704430471369_2673754', u'user_likes': False}, {u'from': {u'id': u'584748571', u'name': u'Tague Griffith'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-22T01:14:59+0000', u'message': u'unless i misunderstood the news, the only people out are the people only running instances in a single data center - so they would be no better off if they ran in this configuration in their own data center', u'id': u'195704430471369_2674079', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-23T15:23:33+0000', u'message': u'Apparently scruffs got hit too, so I'm told', u'id': u'195704430471369_2680948', u'user_likes': False}]}

