vintage.', u'id': u'10150227152786469_5389371', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T00:58:30+0000', u'message': u'It's called a nipple, er TrackPoint.  Touchpads are for losers.  I keep mine disabled.  At least this way it keeps my mac dweeb friends off my computer.', u'id': u'10150227152786469_5389378', u'user_likes': False}, {u'from': {u'id': u'584748571', u'name': u'Tague Griffith'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T01:07:51+0000', u'message': u'lets see your pr0nstache and your bell-bottoms', u'id': u'10150227152786469_5389423', u'user_likes': False}, {u'from': {u'id': u'724045823', u'name': u'Carlos Pedraza'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T01:22:49+0000', u'message': u'Hey, I'm proud to be one of your Mac Dweeb Friends™.', u'id': u'10150227152786469_5389513', u'user_likes': False}, {u'from': {u'id': u'1742996711', u'name': u'Laurel Ramseyer'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-21T03:42:10+0000', u'message': u'ruh roh', u'id': u'10150227152786469_5390127', u'user_likes': False}, {u'from': {u'id': u'601054803', u'name': u'Stef An'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-22T20:41:58+0000', u'message': u'thinkpads, sleep and docking stations are not a good combo. been having the similar issues regularly on my T61p', u'id': u'10150227152786469_5402018', u'user_likes': False}, {u'from': {u'id': u'569966468', u'name': u'Josh Cohen'}, u'like_count': 0, u'can_remove': True, u'created_time': u'2011-04-22T21:23:08+0000', u'message': u'@stefan, everything works good for me as long as I don't unplug/replug the docking station.  I'm using a t61p.', u'id': u'10150227152786469_5402250', u'user_likes': False}]}

